import React from 'react';

function Register ({email, password}) {

  return (
    <div className="register">
      <p className="register__title">Регистрация</p>
      <form className="form">
        <input
          className="form__input"
          id="email" 
          name="email" 
          type="email" 
          value={email}
        />
        <input
          className="form__input"
          id="password" 
          name="password" 
          type="password" 
          value={password} 
        />
      </form>
    </div>
  )
}

export default Register;
